INSERT INTO `company` (`id`, `resellerid`, `company_name`, `contact_name`, `address`, `url`, `map_url`, `tel_no`, `fax_no`, `about`, `email`, `password`, `paypal_email`, `groupon_remarks`, `status`, `ts`) VALUES
(68, 0, 'Meta Body', 'Meta Body', '', 'http://metabody.ca', '', '', '', '<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-size: 1.2em; line-height: 1.5; padding: 0px;">A strong person wrestles you to the ground to show off; a stronger person boosts your self-esteem and then accidentally breaks three of your ribs with a supportive hug. Learn the tenets of both strength and community with today''s Groupon: for $20, you get 20 fitness classes with&nbsp;<a style="color: #0981be; text-decoration: none;" href="http://metabody.ca/index.php?option=com_content&amp;view=article&amp;id=155&amp;Itemid=92">MetaBody</a>&nbsp;(a $300 value).</p>\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-size: 1.2em; line-height: 1.5; padding: 0px;">The inspiring trainers with MetaBody lead troops of workouteers in results-getting 60-90 minute workouts. The&nbsp;<a style="color: #0981be; text-decoration: none;" href="http://metabody.ca/index.php?option=com_content&amp;view=article&amp;id=155&amp;Itemid=92">fun classes</a>&nbsp;utilize a variety of exercises and disciplines to produce full-body results in a supportive environment ideal for both beginners and hard-core core-hardeners alike. Motivational instructors will use your instinctual distrust of routine to their advantage. They&rsquo;ll keep your muscles guessing with new and challenging moves during each session, so you&rsquo;ll never fall into a boring, ineffective routine, such as regular teeth-brushing. Begin a day of litigating with a refreshing early morning Zumba session, or wind down by burning evidence and pounds with a late evening yoga class. In addition to the fitness classes, you will receive a success guide to help prepare for imminent pound-loss, a nutrition guide, and a $100 gift certificate for individual coaching.</p>\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-size: 1.2em; line-height: 1.5; padding: 0px;">Working out with others helps you stay motivated, make friends, and plot government coup d&rsquo;&eacute;tats at your convenience, all while getting fit and staying healthy. So take this opportunity to tone up, shed pounds, help a good cause, and plan the future with a new band of fit friends.</p>', 'info@metabody.ca', 'killer', '', '', 1, '2011-03-07 13:38:37'),
(69, 0, 'ESPN Newsletter', 'ESPN Newsletter', '', 'http://espn.go.com/', '', '1234567890', '1234567890', '<p>Reading is crucial in many sports, as evidenced by pitchers deciphering catchers'' signals, quarterbacks calling audibles based on cloud formations, and hockey players discussing the works of Flaubert in the penalty box. Go where the intellectual meets the athletic with today''s Groupon: for $13, you get a one-year subscription to<em>ESPN The Magazine</em>&nbsp;plus an ESPN T-shirt (a $26 value).</p>', 'test@test.com', '12345', '', '', 1, '2011-03-07 13:48:58'),
(71, 0, 'matchmate', 'fanfd fadfas', '', 'www.matchmate.ca', ' ', '4343434', '', ' online dating site', 'f2farhad@gmail.co', '123456', 'fafd@gmail.com', '', 1, '2011-03-15 16:30:09'),
(67, 0, 'Yushi', 'Yushi', '', 'http://www.yushi.com/', '', '64967559786', '', '<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-size: 1.2em; line-height: 1.5; padding: 0px;">According to Emily Post, napkins may only be used to cover laps, clean up spills, or signal the waiter via semaphore that your table has hit an iceberg. Master restaurant etiquette over a Japanese meal with today''s Groupon to&nbsp;<a style="color: #0981be; text-decoration: none;" href="http://www.yushi.com/">Yushi Bento Bar</a>&nbsp;in Midtown or downtown. Choose from the following options:</p>\r\n<ul style="margin-top: 0px; margin-right: 0px; margin-bottom: 18px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 25px; list-style-type: disc; list-style-position: initial; list-style-image: initial;">\r\n<li style="font-size: 1.2em; padding: 0px; margin: 0px;">For $20 for all-you-can-eat sushi, noodles, salad, and a bottle of sake at the Midtown location, anytime on Tuesdays and Thursdays. This option has an estimated $40 value, but could be worth more depending on what and how much you eat.</li>\r\n<li style="font-size: 1.2em; padding: 0px; margin: 0px;">For $7, you get $14 worth of Japanese fare before 2 p.m. at the Midtown location.</li>\r\n<li style="font-size: 1.2em; padding: 0px; margin: 0px;">For $10, you get $20 worth of Japanese fare after 2 p.m. at the Midtown location.</li>\r\n<li style="font-size: 1.2em; padding: 0px; margin: 0px;">For $7, you get $14 worth of Japanese fare before 2 p.m. at the downtown location.</li>\r\n<li style="font-size: 1.2em; padding: 0px; margin: 0px;">For $10, you get $20 worth of Japanese fare after 2 p.m. at the downtown location.</li>\r\n</ul>\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-size: 1.2em; line-height: 1.5; padding: 0px;">Yushi Bento Box provides a&nbsp;<a style="color: #0981be; text-decoration: none;" href="http://www.yushi.com/ourfood.html">menu</a>&nbsp;stuffed with fresh Japanese and fusion fare, trapping its powerful flavors in tidy sushi packages and eschewing artificial ingredients. Those choosing the all-you-can-eat option can ingest an array of noodle and sushi options while pouring an entire bottle of sake into their head holes. Because the all-you-can-eat meal depends on your appetite and includes access to a variety of specialized rolls that don''t show up on the menu, this option could be worth more than $40 to your stomach.</p>\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-size: 1.2em; line-height: 1.5; padding: 0px;">Sliced fish enthusiasts can rejoice in eel and avocado rolls ($4.95) and spicy tuna laden with wasabi ($5.25), bowling rolls down their throat-alleys or packing them into balls to hurl at passing lobstermen. Bento boxes such as the maki sampler ($9.95) barely restrain the scuttling California crab and salmon rockets housed within, and South Beach sashimi boxes ($14.95) allow salmon and tuna to socialize just like they do in nature. Voracious eaters can also enjoy soups such as the firecracker miso ($4.25) and sides such as steamed pork dumplings (four for $4.45). In the kitchen, Yushi&rsquo;s speedy food whisperers whip up sea-snacks and noodly refreshments fresh daily, carving each compact maki roll from its own giant block of sushi.</p>', 'customers@yushi.com', 'killer', '', '', 1, '2011-03-07 13:30:48');
