INSERT INTO `deals` (`id`, `adminid`, `cityid`, `categoryid`, `companyid`, `resellerid`, `deal_title`, `short_title`, `image`, `thumb`, `deal_description`, `start_time`, `meta_keyword`, `meta_desc`, `end_time`, `min_orders`, `max_orders`, `per_user_max_orders`, `price`, `discount`, `purchases`, `total_bought`, `youtubelink`, `requests`, `featured`, `expire_date`, `commission_percentage`, `commission_amount`, `ismain`, `status`, `tipped`, `tipped_ts`, `is_cancelled`, `cancelled_ts`, `notify_email`, `total_views`, `ts`) VALUES
(139, 0, 0, 14, 67, 0, 'Sushi 1, Noodles, Sake, Salad, and Drinks at Yushi Bento Bar in Midtown or Downtown. Choose from Five Dining Options.', 'Yushi-Salad-Drinks-Deal', '1deal.jpg', '1deal.jpg', '<p>Sliced fish enthusiasts can rejoice in eel and avocado rolls ($4.95) and spicy tuna laden with wasabi ($5.25), bowling rolls down their throat-alleys or packing them into balls to hurl at passing lobstermen. Bento boxes such as the maki sampler ($9.95) barely restrain the scuttling California crab and salmon rockets housed within, and South Beach sashimi boxes ($14.95) allow salmon and tuna to socialize just like they do in nature. Voracious eaters can also enjoy soups such as the firecracker miso ($4.25) and sides such as steamed pork dumplings (four for $4.45). In the kitchen, Yushi’s speedy food whisperers whip up sea-snacks and noodly refreshments fresh daily, carving each compact maki roll from its own giant block of sushi.</p>              ', '2011-03-01 14:33:31', 'Yushi, Deals', 'Sushi, Noodles, Sake, Salad, and Drinks at Yushi Bento Bar in Midtown or Downtown. Choose from Five Dining Options.', '2011-08-31 14:33:34', 5, 500, 1, 7, 50, 14, 15, '', 8, 0, '2011-12-31 14:33:41', 40, 2.8, 1, 1, 1, '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 2, 2, '2011-03-07 13:34:14'),
(140, 0, 0, 14, 68, 0, '$20 for 20 Classes at MetaBody Fit Pass Locations ($300 Value)', 'classes-at-metabody', '2011/03/large_140.jpg', '2011/03/thumb_140.jpg', '', '2011-03-01 14:42:23', 'body, fitness, classes', '$20 for 20 Classes at MetaBody Fit Pass Locations ($300 Value)', '2011-06-30 14:42:25', 50, 200, 1, 20, 93, 300, 2, '', 0, 0, '2011-12-31 14:42:29', 50, 10, 2, 1, 0, '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 0, 5, '2011-03-07 13:43:30'),
(141, 0, 0, 14, 69, 0, '$13 for a One-Year Subscription to "ESPN The Magazine" Plus an ESPN T-shirt ($26 Value)', 'One-year-ESPN-Newsletter', '1deal.jpg', '1deal.jpg', 'ESPN and its various information-rich endeavors allow foam-fingered sports fans to follow their favorite teams and players with highly detailed stats and in-depth coverage. ESPN The Magazine is a touchable sports publication filled with stunning photographs of baseball players hitting home runs, basketball players dunking, and football players buying homes to store rare stamps. In addition to sating appetites for sporty visuals and athletic insight, today\\''s deal cloaks fans in a 100% cotton ESPN logo tee.', '2011-03-01 14:51:22', 'espns newsletter', '$13 for a One-Year Subscription to "ESPN The Magazine" Plus an ESPN T-shirt ($26 Value)', '2011-06-30 14:51:24', 20, 150, 1, 13, 50, 26, 1, '', 0, 0, '2011-09-29 14:51:30', 25, 3.25, 2, 1, 0, '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 0, 0, '2011-03-07 13:51:50');
