INSERT INTO `newsletter_template` (`id`, `subject`, `body`, `type`, `key`, `description`, `status`) VALUES
(2, 'Daily Newsletter', '<p><span style="font-size: large;"><strong>DAILY NEWSLETTER</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>#deal-detail#</p>\r\n<p>We are offering great deals for you, please visit your "Recent Deals" section for further detail about recent deals. We work in all kind kind of products, food, electronics, excersice, etc....</p>', 1, NULL, NULL, 1),
(3, 'New Deal', '<table style="font-family: Arial, Helvetica, sans-serif; width: 500px;" border="0" cellspacing="0" cellpadding="0" align="center" bgcolor="#EEEEEE">\r\n<tbody>\r\n<tr>\r\n<td style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 18px; padding: 2px;" colspan="2" height="25">{deal_title}</td>\r\n</tr>\r\n<tr>\r\n<td width="161" height="192" valign="top">\r\n<div style="width: 130px; margin: 10px; font-family: Arial, Helvetica, sans-serif; font-size: 16px; font-weight: bold; text-align: center; padding: 5px; background-color: #00cc33;"><a style="color: #ffffff; text-decoration: none;" href="{oredr_now}">Buy Now</a></div>\r\n</td>\r\n<td width="339" align="center" valign="top"><img src="{deal_image}" alt="" /></td>\r\n</tr>\r\n<tr>\r\n<td style="padding-top: 10px; padding-bottom: 10px;" colspan="2">\r\n<div style="width: 245px; float: left;"><strong>Fine Prints</strong><br />{fineprints}</div>\r\n<div style="width: 245px; float: right;"><strong>Highlights</strong><br />{highlights}</div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px; font-size: 10px;" colspan="2">This email was sent to you by {site_title}</td>\r\n</tr>\r\n</tbody>\r\n</table>', 0, NULL, 'daily newsletter', 1),
(13, 'Deal Subscription', '<table style="font-family: Arial, Helvetica, sans-serif; width: 500px;" border="0" cellspacing="0" cellpadding="0" align="center" bgcolor="#EEEEEE">\r\n<tbody>\r\n<tr>\r\n<td style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 14px; padding: 2px; background-color: #666666; color: #ffffff;" height="25">\r\n<p>Hello {firstname} &nbsp; {lastname}</p>\r\n<p>You have successfully subscriebd for following deal:</p>\r\n<br /></td>\r\n</tr>\r\n<tr>\r\n<td style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 18px; padding: 2px;" height="25">{deal_title}</td>\r\n</tr>\r\n<tr>\r\n<td height="192" align="center" valign="top"><img src="{deal_image}" alt="" /></td>\r\n</tr>\r\n<tr>\r\n<td style="padding-top: 10px; padding-bottom: 10px;">\r\n<div style="width: 245px; float: left;"><strong>Fine Prints</strong><br />{fineprints}</div>\r\n<div style="width: 245px; float: right;"><strong>Highlights</strong><br />{highlights}</div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px; font-size: 10px;">\r\n<p>If the deal is tipped we will charge your payment and send you voucher. If deal did not tip no payment will be charged.</p>\r\n<br />\r\n<p>you can check any time your Deal status on :&nbsp; {siteurl}</p>\r\n<br />\r\n<p>Thank You</p>\r\n<br />\r\n<p>{sitename}</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px; font-size: 10px;">This email was sent to you by {sitename}</td>\r\n</tr>\r\n</tbody>\r\n</table>', 0, NULL, 'this is sent when a user subscribe the deal', 1),
(4, 'Account Created', '<!-- p { padding:0px; margin:0px; } -->\r\n<p><span style="font-size: medium;"><strong>Your registration is confirmed</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>Hi {firstname} {lastname},</p>\r\n<p>Thank you for joining us. Buying on our website is simple, fast and cheap. Check the site daily and look out for emails announcing the next deal.</p>\r\n<p>Here are your login credentials:</p>\r\n<p>Login url: <a href="{siteurl}/index.php?type=my_account">{siteurl}index.php?type=my_account</a></p>\r\n<p>Username: {email}</p>\r\n<p>Password: {password}</p>\r\n<p>Please save this email for future reference</p>\r\n<p>&nbsp;</p>\r\n<p>Thank You,</p>\r\n<p>{sitename}</p>\r\n<p>PS Don''t forget to recommend us to your friends and earn $$$ in your account when they sign up.</p>', 0, NULL, 'this newsletter is sent when user signup new account', 1),
(5, 'Invitation from your friend', '<p><span style=\\"font-family: arial,helvetica,sans-serif;\\"><span style=\\"font-size: large;\\"><strong>Invitation to join {site_title}<br /></strong></span></span></p>\r\n<br />\r\n<p><span style=\\"font-family: arial,helvetica,sans-serif;\\">Dear {firstname} {lastname},</span></p>\r\n<p><span style=\\"font-family: arial,helvetica,sans-serif;\\"><br /></span></p>\r\n<p><span style=\\"font-family: arial,helvetica,sans-serif;\\">You have been invited to join {site_title}, your friend, {sendername}, has sent you this invitation. Just click on the link below and start saving 50% or more on restaurants, spa services, and much, much more.<br /></span></p>\r\n<p><span style=\\"font-family: arial,helvetica,sans-serif;\\">{referallink}</span></p>\r\n<p><span style=\\"font-family: arial,helvetica,sans-serif;\\"><br /></span></p>\r\n<p><span style=\\"font-family: arial,helvetica,sans-serif;\\">Thank You,</span></p>\r\n<p><span style=\\"font-family: arial,helvetica,sans-serif;\\">{sendername} and {site_title}</span></p>', 0, NULL, 'this is used from invitefriend module', 1),
(6, 'Contact form submitted to admin', '<p>Thank you for your email. We will respond within the next 2 business days.</p>\r\n<p>&nbsp;</p>\r\n<p>The Comclone.com Team</p>', 1, NULL, NULL, 1),
(10, 'Subscription Processed', '<table style="font-family: Arial, Helvetica, sans-serif; width: 500px;" border="0" cellspacing="0" cellpadding="0" align="center" bgcolor="#EEEEEE">\r\n<tbody>\r\n<tr>\r\n<td style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 14px; padding: 2px; background-color: #666666; color: #ffffff;" height="25">\r\n<p>Hello {first_name} &nbsp; {last_name}</p>\r\n<p>We have charged your susbcription for the following deal:</p>\r\n<br /></td>\r\n</tr>\r\n<tr>\r\n<td style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 18px; padding: 2px;" height="25">{deal_title}</td>\r\n</tr>\r\n<tr>\r\n<td height="192" align="center" valign="top"><img src="{deal_image}" alt="" /></td>\r\n</tr>\r\n<tr>\r\n<td style="padding-top: 10px; padding-bottom: 10px;">\r\n<div style="width: 245px; float: left;"><strong>Fine Prints</strong><br />{fineprints}</div>\r\n<div style="width: 245px; float: right;"><strong>Highlights</strong><br />{highlights}</div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px; font-size: 14px; text-align: center;">{coupon_link}</td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px; font-size: 10px;">\r\n<p>You can print your voucher using above link or you can always login to your account and check orders and print vouchers</p>\r\n<br />\r\n<p>Thank You</p>\r\n<br />\r\n<p>{sitename}</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 5px; font-size: 10px;">This email was sent to you by {sitename}</td>\r\n</tr>\r\n</tbody>\r\n</table>', 0, NULL, 'this is sent when a user is successfully charged after deal is tipped', 1),
(17, 'Deal did not Tip', '<!-- table { 	font-family:Arial, Helvetica, sans-serif; } div { 	font-family:Arial, Helvetica, sans-serif; } -->\r\n<div style="width: 800px;">\r\n<div>\r\n<h1>Deal has been canceled and not tipped</h1>\r\n</div>\r\n<div>\r\n<h2><a href="{site_url}index.php?type=recent_deals&amp;action=show&amp;id={dealid}">{deal_title}</a></h2>\r\n</div>\r\n<br />\r\n<div><strong>Detail:</strong></div>\r\n<div>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Minimum Orders Limit:</td>\r\n<td>{min_limit}</td>\r\n</tr>\r\n<tr>\r\n<td>Maximum Orders Limit:</td>\r\n<td>{max_limit}</td>\r\n</tr>\r\n<tr>\r\n<td>Total Bought:</td>\r\n<td>{total_bought}</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div><br />\r\n<p>Thank You,<br />SACOM GROUP</p>\r\n</div>\r\n</div>', 1, NULL, NULL, 1),
(18, 'Deal is Tipped', '<!-- table { 	font-family:Arial, Helvetica, sans-serif; } div { 	font-family:Arial, Helvetica, sans-serif; } -->\r\n<div style="width: 800px;">\r\n<div>\r\n<h1>Deal has been tipped</h1>\r\n</div>\r\n<div>\r\n<h2><a href="{site_url}index.php?type=recent_deals&amp;action=show&amp;id={dealid}">{deal_title}</a></h2>\r\n</div>\r\n<br />\r\n<div><strong>Detail:</strong></div>\r\n<div>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Minimum Orders Limit:</td>\r\n<td>{min_limit}</td>\r\n</tr>\r\n<tr>\r\n<td>Maximum Orders Limit:</td>\r\n<td>{max_limit}</td>\r\n</tr>\r\n<tr>\r\n<td>Total Bought:</td>\r\n<td>{total_bought}</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div><br />\r\n<p>Thank You,<br />SACOM GROUP</p>\r\n</div>\r\n</div>', 1, NULL, NULL, 1),
(15, 'Voucher Template', '<table style="width: 1004px; border: 6px dashed #666666;" cellspacing="0" cellpadding="0" align="center" bgcolor="#ffffff">\r\n<tbody>\r\n<tr>\r\n<td align="center" valign="top">\r\n<table style="background: url(../images2/table2_back.png) no-repeat scroll 0% 0% transparent; width: 682px; height: 155px;" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td align="center" valign="bottom">\r\n<table style="width: 671px;" border="0" cellspacing="0" cellpadding="5" align="center">\r\n<tbody>\r\n<tr>\r\n<td colspan="2" width="761" align="right" valign="middle"><!--SEARCH STARTS HERE --> <!--SEARCH ENDS HERE --></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td align="center" valign="top">\r\n<table style="width: 671px;" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td style="padding-left: 0px;" width="477" height="187" valign="top">\r\n<table style="width: 97%; font-family: Arial,Helvetica,sans-serif;" border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td style="font-size: 22px; font-weight: bold; color: #62a408; font-family: Verdana, Arial, Helvetica, sans-serif; padding-left: 4px; text-align: left;" colspan="2">{deal_title}</td>\r\n</tr>\r\n<tr>\r\n<td style="font-size: 19px; color: #54575d; text-align: left; padding-left: 4px;" colspan="2"><br /></td>\r\n</tr>\r\n<tr>\r\n<td colspan="2"><span style="font-family: arial black,avant garde;"><span style="font-size: small;"><strong>No Cash Value</strong></span></span></td>\r\n</tr>\r\n<tr>\r\n<td colspan="2">\r\n<p><span style="font-family: arial black,avant garde;"><span style="font-size: small;"><strong>Must Present voucher for redemptio</strong></span></span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan="2">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td colspan="2"><span style="font-family: arial black,avant garde;"><span style="font-size: small;"><strong>Date Purchased </strong></span><span style="fon