0px; font-weight: bold;">{price}</td>\r\n<td style="color: #424148; font-weight: bold;">{saving}</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: center;" colspan="2">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style="padding-left: 10px; color: #424148; font-weight: bold;" colspan="2">Order ID: {orderid}</td>\r\n</tr>\r\n<tr>\r\n<td style="# color: #424148; padding-left: 10px; font-weight: bold; color: #000000;" colspan="2">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style="# color: #424148; padding-left: 10px; font-weight: bold; color: #000000;" colspan="2">Quantity: {quantity}</td>\r\n</tr>\r\n<tr>\r\n<td style="# color: #424148; padding-left: 10px; font-weight: bold; color: #000000;" colspan="2">Amout:&nbsp; {amount}</td>\r\n</tr>\r\n<tr>\r\n<td style="# color: #424148; padding-left: 10px; font-weight: bold; color: #000000;" colspan="2">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div style="font-family: Arial, Helvetica, sans-serif; padding-top: 5px;"><a style="color: #0066cc; text-decoration: none; font-size: 12px;" onclick="window.print();" href="javascript:void(0);">\r\n<h1 style="text-align: center;">Print this voucher</h1>\r\n</a></div>', 1, NULL, NULL, 1),
(12, 'Newsletter Subscription', '<p>You are successfully  subscribed on our website and the following is your temporary login detail:</p>\r\n<p>Link: {siteurl}</p>\r\n<p>Email: {email}<br /> Password: {password}</p>\r\n<p>Thank You.</p>\r\n<p>{sitename}</p>\r\n', 0, NULL, 'this newsletter is used at nodeal module and subscribe module', 1);
INSERT INTO `pages` (`id`, `categoryid`, `title`, `body`, `status`, `ts`) VALUES
(54, 19, 'Privacy Policy', '<h1 style="margin-top: 5px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; color: #003d71; font-size: 30px; font-weight: 700; letter-spacing: -1px;">Privacy Policy</h1>\r\n<p><strong>comclone.com.com Privacy Policy</strong></p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">comclone.com.com is committed to protecting the privacy of visitors to our websites, as well as our members and partners. comclone.com.com has established this Privacy Policy to explain what information we collect through these websites and how it is used.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">In this policy, "comclone.com.com" refers to staff, board members, cooperating attorneys, interns, volunteers, and consultants of comclone.com.com, all of whom are bound by law or contract to keep information they receive as part of their work for comclone.com.com confidential.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">comclone.com.com does not sell or rent personally identifiable member, customer or employee information under any circumstances, and we do not share information without prior consent except as compelled by law. (See discussion below.)</p>\r\n<p><strong>Information Gathered by comclone.com.com Site</strong></p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">For visitors to our website, we may, but generally do not, log standard technical information, such as the numerical Internet protocol (IP) address of the computer you are using; the browser software you use and your operating system; and the Internet address of the website from which you linked directly to our site. Circumstances in which we temporarily log standard technical information include conducting site testing, diagnosis of technical problems, and defending against attacks on the site. We generally do log the date and time users access our site on an anonymous basis. For more information on comclone.com.com''s position on data logging, see the EFF''s Best Practices for Online Service Providers.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">In order to access the member functionality of comclone.com.com we use a persistent cookie. We may also use session cookies from time to time. Session cookies expire when you close your browser. You can set your browser to refuse cookies, and use Tor if you wish to keep your IP number and other technical information anonymous.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">In addition, comclone.com.com collects and retains information you submit to us. It is up to you whether to submit information to us, and how much information to provide. If you choose to become a comclone.com.com member, we ask for your name, email address, city, state/province, postal or zip code, country of residence, and phone number, and invite you to select a password. For online donors and shoppers, we also ask for your credit card number or Paypal login information. We also maintain records of our members'' use of the site and may use this data on an anonymous basis periodically. If you use some of the online financial services offered by comclone.com.com, you are asked to provide personal information, such as a shipping address, necessary to complete your transaction.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">We may ask for additional personal information when you provide feedback or comments, or otherwise communicate with us.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">From time to time, we may ask for personal information on other portions of the site, such as asking you to sign a petition, participate in a contest, or provide other user generated content to us.</p>\r\n<p><strong>comclone.com.com''s Use of Information</strong></p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">comclone.com.com sees it as its mission to protect privacy, defend freedom, and protect your rights in the digital world. We are your friends. If you invite another person to join comclone.com.com, we will ask for that person''s name and online contact information. We use this information to contact and, if necessary, remind that person that he or she has been invited to join comclone.com.com.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">If you provide information for publication, such as writing a review or submitting other editorial content, we will publicly credit you for this work.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">We may run surveys, contests, or similar activities through this site. Such information will be used for the purposes for which it was collected.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">We look at technical information to diagnose problems with our server and to administer the comclone.com.com site.</p>\r\n<p><strong>Third-Party Service Providers</strong></p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">Portions of the comclone.com.com site may be operated by a third-party service provider ("Provider"). Provider may place cookies on your computer in order to store information, such as items placed in your shopping cart, or storing your account login when using the Affiliate Center. Provider logs standard technical information, such as the numerical Internet protocol (IP) address of the computer you are using; the browser software you use and your operating system; the date and time you access our site; and the Internet address of the website from which you linked directly to our site.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">Our Provider also stores and organizes the personal information collected through this site on our behalf. The information remains under our control, and our agreement with Provider requires the information to be kept confidential and disclosed only to Provider''s employees who require such access in the course of their assigned duties. Provider has however, not agreed to cooperate with comclone.com.com in seeking a protective order, if necessary, to protect this information from legal process. We will seek to accomplish this in all cases, but this cannot be guaranteed. comclone.com.com may change providers from time to time, and will transfer stored information to the new provider subject to similar restrictions.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">comclone.com.com''s search engine functionality is currently operated in house. All search queries may be retained for analysis and will always be access on an anonymous basis. comclone.com.com may however change the search engine provider from time to time.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">From time to time, comclone.com.com may work with third-party consultants or other service providers who may have access to personally identifiable information. In such cases, we will restrict their use of personally identifiable information in accordance with their assigned tasks and subject to the limitations of this privacy policy.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">comclone.com.com''s site provides links to a wide variety of third-party websites. comclone.com.com is not responsible for, and does not have any control over, the privacy practices or the content of such third parties. We encourage users to read the privacy policies of any website visited.</p>\r\n<p><strong>Disclosure of Your Information</strong></p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">While comclone.com.com endeavors to provide the highest level of protection for your information, we may disclose personally identifiable information about you to third parties in limited circumstance, including: (1) with your consent; or (2) when we have a good faith belief it is required by law, such as pursuant to a subpoena or other judicial or administrative order.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">If we are required by law to disclose the information that you have submitted, we will attempt to provide you with notice (unless we are prohibited) that a request for your information has been made in order to give you an opportunity to object to the disclosure. We will attempt to provide this notice by email, if you have given us an email address or by postal mail if you have entered a postal address. If you do not challenge the disclosure request, we may be legally required to turn over your information.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">In addition, we will independently object to requests for access to information about users of our site that we believe to be improper.</p>\r\n<p><strong>Updating or Removing Your Information</strong></p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">You may choose to correct, update, or delete the membership information you have submitted to us by sending an email requesting changes to sales@comclone.com.com. Furthermore, if we inadvertently collect more personal information than intended, we endeavor to delete the extraneous information. However, please understand that deleted information may continue to persist on back-up media.</p>\r\n<p><strong>Changes to Our Policies</strong></p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">comclone.com.com''s Privacy Policy may change from time to time. However, any revised privacy policy will be consistent with comclone.com.com''s stance on privacy issues. If we make any substantive changes to our policies, we will place notice on comclone.com.com and post notice of changes on this page.</p>\r\n<p><strong>Security</strong></p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">comclone.com.com employs industry standard security measures to protect the loss, misuse, and alteration of the information under our control. Information submitted through the online payment system processes is encrypted through a Secured Socket Layer (SSL) connections, which protects the information in transit.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">Although we make good faith efforts to store information collected by comclone.com.com in a secure operating environment, we cannot guarantee complete security. Information collected by comclone.com.com will be maintained for a length of time appropriate to our needs. However, we generally do not retain credit card information unless you choose to have us do so.</p>\r\n<p><strong>Updated December 11, 2009</strong></p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">This Privacy Policy is based extensively on that of the Electronic Frontier Foundation, a leading champion of public interests in issues affecting digital rights. Their privacy policy can viewed by going to http://www.eff.org/policy/</p>', 0, '2011-03-02 07:03:15');
