(53, 19, 'Terms of Service', '<h1 style="margin-top: 5px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; color: #003d71; font-size: 30px; font-weight: 700; letter-spacing: -1px;">Terms of Service</h1>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">IN THESE TERMS, "WE," "US," "ITS" AND "OUR" REFER TO comclone.com.com, its parent corporations, subsidiaries, and affiliated companies ("COMPANY"), AND "YOU" AND "YOUR" REFER TO YOU. Before using comclone.com.com, please read these Terms relating to your use of this web site carefully.</p>\r\n<ol style="margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 20px;">\r\n<li style="font-size: 12px; line-height: 16px; margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;"><strong>USE OF SERVICES</strong>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">COMPANY offers online resources for social networking, commerce and content creation on comclone.com.com, including communications tools, affiliate marketing, member to member sales, online forums, personalized content and branded programming.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">COMPANY offers comclone.com.com to you, provided that you represent that you are of legal age to create binding contractual and financial obligations for any liability that you may incur as a result of your use of comclone.com.com</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">Your use of comclone.com.com constitutes your agreement with the Terms and the comclone.com.com policies ("Policies") posted from time to time and the Privacy Statement, both of which 