t on this web site and that you give to other web site users. You assume all risks associated with dealing with other users. We expect that you will use caution and common sense when using this web site.</p>\r\n</li>\r\n<li style="font-size: 12px; line-height: 16px; margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;"><strong>REGISTRATION OBLIGATIONS</strong>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">In order to access certain Services, you may be required to register and obtain an account with comclone.com com.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">When registering, you must: (a) provide true, accurate, current and complete information (collectively, the "Registration Data") and (b) update the Registration Data as necessary. If, after investigation, we have reasonable grounds to suspect that your information is untrue, inaccurate, not current or incomplete, we may suspend or terminate your account and prohibit any or all use of comclone.com.com by you.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">You will receive a password and account designation upon completing a comclone.com.com registration process. You are responsible for maintaining the confidentiality of your password, and for all activities that occur through your account. You agree to immediately notify COMPANY of any unauthorized use of your password or account or any other breach of security. COMPANY will not be liable for any loss or damage arising from your failure to provide accurate information or to keep your password secure. Use unique numbers, letters, and special characters for passwords and log off from your account at the end of each session.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">comclone.com.com handles user Registration Data in accordance with the comclone.com.com Privacy Statement accessible at<a style="color: #3a9ab6; text-decoration: none;" href="http://www.stealthedeal.com/Privacy">http://www.comclone.com.com/privacy</a></p>\r\n</li>\r\n<li style="font-size: 12px; line-height: 16px; margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;"><strong>APPROPRIATE CONDUCT AND RELATED USER REPRESENTATIONS AND WARRANTIES</strong>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">As used throughout these Terms, "Content" means any text, data, software, music, sound, photograph, graphic, video, message, or material, whether publicly posted, or privately transmitted via comclone.com.com.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">You agree that you are responsible for your own conduct and any Content that you or anyone using your account creates, transmits or displays when on comclone.com.com ("Your Content") and for any consequences thereof. "Content" includes text or data entered into and stored by publicly-accessible site features such as feedback ratings, articles or comments ("comclone.com.com Public Content"), and any input, suggestions, or other feedback ("Feedback") relating to or in the comclone.com.com site or any Service.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">When you create or make available Your Content, you thereby represent and warrant that:</p>\r\n<ol class="alpha" style="margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 20px;">\r\n<li style="font-size: 12px; line-height: 16px; margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">you own or have sufficient rights to post Your Content posted by, on or through comclone.com.com;</li>\r\n<li style="font-size: 12px; line-height: 16px; margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">the posting of Your Content on or through comclone.com.com does not violate the privacy rights, publicity rights, copyrights, contract rights or any other rights of any person;</li>\r\n<li style="font-size: 12px; line-height: 16px; margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">you have fully complied with any third-party licenses relating to Your Content, agree to pay for all royalties, fees and any other monies owning any person by reason of any of Your Content that you posted to or through comclone.com.com;</li>\r\n<li style="font-size: 12px; line-height: 16px; margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">Your Content does not contain any viruses, worms, Trojan horses, malicious code or other harmful or destructive content;</li>\r\n<li style="font-size: 12px; line-height: 16px; margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">Your Content is not obscene, lewd, lascivious, excessively violent, harassing, libelous or slanderous, does not advocate the violent overthrow of governments, does not incite, encourage or threaten immediate physical harm against another, does not violate any applicable law, regulation, or rule, and does not violate the privacy or publicity rights of any third party;</li>\r\n<li style="font-size: 12px; line-height: 16px; margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">Your Content does not contain material that solicits personal information from anyone under 18 or exploit people under the age of 18 in a sexual or violent manner, and does not violate any federal or state law concerning child pornography or otherwise intended to protect the health and wellbeing of minors;</li>\r\n<li style="font-size: 12px; line-height: 16px; margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">if your employer has rights to intellectual property you create, you have either (i) received permission from your employer to make available Your Content, or (ii) secured from your employer a waiver as to all rights in or to Your Content;</li>\r\n<li style="font-size: 12px; line-height: 16px; margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">Your Content does not violate any state or federal law designated to regulate electronic advertising;</li>\r\n<li style="font-size: 12px; line-height: 16px; margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">Your Content does not constitute, contain, install or attempt to install or promote spyware, malware or other computer code, whether on COMPANY''s or others computers or equipment, designated to enable you or others to gather information about or monitor the online or other activities of another party;</li>\r\n<li style="font-size: 12px; line-height: 16px; margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">Your Content does not inundate the Website with communications or other traffic suggesting no serious intent to use the Website for its stated purpose;</li>\r\n<li style="font-size: 12px; line-height: 16px; margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">Your Content does not otherwise violate, or link to material that violates any provision of this Agreement;</li>\r\n<li style="font-size: 12px; line-height: 16px; margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">Your Content does not contain content that endorses or promotes racism, bigotry, hatred, or physical harm of any kind against another group or individual; and</li>\r\n<li style="font-size: 12px; line-height: 16px; margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">Your Content does not contain content that discriminates, incites harassment or advocates harassment of any group or individual.</li>\r\n</ol>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">You agree to use comclone.com.com only for purposes that are legal, and in accordance with the Terms, including without limitation the Privacy Statement, Service-Specific Rules and any applicable comclone.com.com Policies. To report any activity or Content that may violate the Terms, please email sales@comclone.com.com, including full email headers.</p>\r\n</li>\r\n<li style="font-size: 12px; line-height: 16px; margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;"><strong>NO UNLAWFUL OR PROHIBITED USE</strong>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">In connection with your use of comclone.com.com, you shall comply with all applicable international, state, federal, local laws, including without limitation, all laws regulating exports. You are aware that all postings of open source encryption code must be simultaneously reported by email to the U.S. government. You are responsible for submitting this email report to the U.S. government in accordance with procedures described in: http://www.bis.doc.gov/encryption/PubAvailEncSourceCodeNofify.html and Section 740.13(e) of the EAR.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">In addition to the above, you may not access or use comclone.com.com for any purpose other than that for which COMPANY makes it available. Certain activities, even if legal, may violate the common rules of etiquette governing Content, as determined by COMPANY in its sole discretion.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-l