of COMPANY to exercise or enforce any right or provision of the Terms shall not constitute a waiver of such right or provision. If any provision of the Terms is found by a court of competent jurisdiction to be invalid, the parties nevertheless agree that the court should endeavor to give effect to the parties'' intentions as reflected in the provision, and the other provisions of the Terms remain in full force and effect.</p>\r\n</li>\r\n<li style="font-size: 12px; line-height: 16px; margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;"><strong>TIME LIMIT FOR FILING CLAIMS</strong>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">Any claim or cause of action arising out of or related to use of comclone.com.com or the Terms must be filed within one (1) year after such claim or cause of action arose or be forever barred.</p>\r\n</li>\r\n<li style="font-size: 12px; line-height: 16px; margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;"><strong>ASSIGNMENT</strong>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">In our sole discretion, we may assign these Terms by providing notice in accordance with the notice Section should COMPANY ever file for bankruptcy or in the event of a sale, merger, acquisition or other transfer of all or substantially all of comclone.com.com.</p>\r\n</li>\r\n<li style="font-size: 12px; line-height: 16px; margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;"><strong>TERM AND SURVIVAL</strong>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">These Terms shall remain in full force and effect while you use the comclone.com.com Services or are a user of comclone.com.com. You may terminate your use or participation at any time, for any reason, by emailing sales@comclone.com.com and putting DELETE MY ACCOUNT in subject line. COMPANY may terminate your use or participation at any time for violation of these Terms or any laws or to protect the integrity of the web site, the networks or services connected to the web site or other users. COMPANY reserves the right at any time and from time to time to modify or discontinue, temporarily or permanently, comclone.com.com or any Service. COMPANY shall not be liable to any user or other third party for any such modification, suspension or discontinuance. Even after your use or participation is terminated, the material terms of these Terms will remain in effect.</p>\r\n</li>\r\n<li style="font-size: 12px; line-height: 16px; margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;"><strong>REFUND POLICY</strong>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">You may refund your listing at any time during the first 72 hours after you have purchased it. Simply email a copy of your receipt to sales@ comclone.com.com.</p>\r\n</li>\r\n<li style="font-size: 12px; line-height: 16px; margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;"><strong>DELIVERY POLICY</strong>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">All sales are delivered online. A receipt will be sent to your email and you will be prompted to enter your listing details. If for any reason there is a problem during the sign-up process and you are unable to submit your listing, please email sales@comclone.com.com and we will be happy to assist you.</p>\r\n<p style="font-size: 12px; line-height: 18px; margin-top: 5px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;">Updated October 2nd 2007 These terms and conditions are based on those set forth by Sourceforge Inc., and their website Sourceforge.net. Their original Terms and Conditions may be found at http://sourceforge.net/docman/display_doc.php?group_id=1&amp;docid=6048</p>\r\n</li>\r\n</ol>', 0, '2011-03-02 07:01:30'),
