INSERT INTO `pages` (`id`, `categoryid`, `title`, `body`, `status`, `ts`) VALUES
(55, 20, 'FAQ', '<h1 style="margin-top: 5px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; color: #003d71; font-size: 30px; font-weight: 700; letter-spacing: -1px;">Frequently Asked Questions</h1>\r\n<h2 style="margin-top: 0px; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; color: #44abcd; font-size: 18px;">Our users have questions. Well we have answers!</h2>\r\n<h4 style="color: #003d71; font-family: Helvetica, Arial; font-size: 20px; line-height: 24px; margin: 0px;">What is comclone.com.com?</h4>\r\n<blockquote style="color: #666666; font-family: Georgia; font-style: italic; font-size: 14px; padding: 15px; margin: 15px; border: 1px dotted #cfdabb;">We know there are lots of deals out there, so many deals in fact as to be almost overwhelming. It is like being covered in chocolate sauce and bees, kind of fun, but basically unpleasant. You know you want to save your money, but on what? comclone.com wades through the mountains of choices for you to bring you one new and exciting thing to try in your city at an unbeatable price everyday!</blockquote>\r\n<h4 style="color: #003d71; font-family: Helvetica, Arial; font-size: 20px; line-height: 24px; margin: 0px;">I like today''s deal. How do I purchase it?</h4>\r\n<blockquote style="color: #666666; font-family: Georgia; font-style: italic; font-size: 14px; padding: 15px; margin: 15px; border: 1px dotted #cfdabb;"><strong>Step one:</strong>&nbsp;Make an account with us.<br /><strong>Step two:</strong>&nbsp;Make sure you are logged in and start buying some deals! The large BUY NOW button will take you to the checkout process. After you go through our payment process to confirm your order your confirmation will be e-mailed to you immediately and your voucher will be in your comclone.com.com account ready and waiting for you to print it off. Simple eh?</blockquote>\r\n<h4 style="color: #003d71; font-family: Helvetica, Arial; font-size: 20px; line-height: 24px; margin: 0px;">I have my voucher. now what? Do I actually have to go outside to use it?</h4>\r\n<blockquote style="color: #666666; font-family: Georgia; font-style: italic; font-size: 14px; padding: 15px; margin: 15px; border: 1px dotted #cfdabb;">Yes! That is most of the fun. Do you own a printer? Yes? Good. Just print it out and take it to the applicable retailer. They will be happy to see it, especially if you use it in tandem with money. If you follow these instructions everything should go off without a hitch. And if you have some friends you should tell them about how awesome comclone.com.com is. I''m sure it''s been a while since you''ve seen each other and now would be a good time to catch up, why not go out for a deal together?</blockquote>\r\n<h4 style="color: #003d71; font-family: Helvetica, Arial; font-size: 20px; line-height: 24px; margin: 0px;">Can a Deal Sell out? What happens if I miss a Deal I really wanted?</h4>\r\n<blockquote style="color: #666666; font-family: Georgia; font-style: italic; font-size: 14px; padding: 15px; margin: 15px; border: 1px dotted #cfdabb;">No. Unless you and several hundred million of your friends decide to buy a Deal there is next to no chance that a Deal will sell out. And as for missing the Deal you should probably&nbsp;&nbsp;to get the jump on the all the great Daily Deals so that you never have to miss out on any of the awesome savings ever again. However, on the off chance that you saw the Deal, but through unforeseen circumstances (Wolverine stampede?) You couldn''t get home in time to purchase it you can request the deal by going into Recent deals! Also there is a fairly good chance (especially if it was a good Deal) that it will come up as a side-deal so you will have another chance!</blockquote>\r\n<h4 style="color: #003d71; font-family: Helvetica, Arial; font-size: 20px; line-height: 24px; margin: 0px;">Can I buy a voucher as a gift?</h4>\r\n<blockquote style="color: #666666; font-family: Georgia; font-style: italic; font-size: 14px; padding: 15px; margin: 15px; border: 1px dotted #cfdabb;">Yes! FACT. There are very few things nowadays that you cannot buy for someone as a gift both on and off the Internet. Coupons included. END OF FACT. However, sometimes you can''t give them as gifts; but only if it is specified in the fine print of that particular deal.</blockquote>\r\n<h4 style="color: #003d71; font-family: Helvetica, Arial; font-size: 20px; line-height: 24px; margin: 0px;">Hey! What happens if my voucher expires?</h4>\r\n<blockquote style="color: #666666; font-family: Georgia; font-style: italic; font-size: 14px; padding: 15px; margin: 15px; border: 1px dotted #cfdabb;">Well, here is the thing, business is a crazy rabies having polecat sometimes and with a crazy rabies having polecat you never really know how things are going to turn out. If you wait too long then your voucher for a romantic dinner probably won''t be honored at that new tattoo place where the restaurant used to be. So it''s probably in your best interest to get out there and start enjoying your awesome deal!</blockquote>\r\n<h4 style="color: #003d71; font-family: Helvetica, Arial; font-size: 20px; line-height: 24px; margin: 0px;">I confirmed my purchase, I still don''t have a voucher.</h4>\r\n<blockquote style="color: #666666; font-family: Georgia; font-style: italic; font-size: 14px; padding: 15px; margin: 15px; border: 1px dotted #cfdabb;">Hmm. Weird. There are a few reasons this could be happening. Number one Make sure we are not in your spam list, number two never compare us to that horrible lunchmeat EVER again. Number three if you are paying by echeck; it takes a few business days (Different from regular days) to confirm your account. However once we have made sure the money is there you can feel free to log back into comclone.com.com and claim your voucher! If none of these apply then please drop us a line at&nbsp;<a style="color: #3a9ab6; text-decoration: none;" href="mailto:support@StealTheDeal.com">support@comclone.com.com</a>&nbsp;and we''ll see if we can''t get that sorted out for you.</blockquote>\r\n<h4 style="color: #003d71; font-family: Helvetica, Arial; font-size: 20px; line-height: 24px; margin: 0px;">Is comclone.com safe?</h4>\r\n<blockquote style="color: #666666; font-family: Georgia; font-style: italic; font-size: 14px; padding: 15px; margin: 15px; border: 1px dotted #cfdabb;">Yes. 100%. comclone.com is as safe as a pillow fight with a bunch of senior citizens. We do not store credit card information in our database and all our payment process is handled via secure online methods with encryptions. It is like a forgetful bodyguard who you can tell all your secrets to! Or an etch-a-sketch with big beefy arms.</blockquote>\r\n<h4 style="color: #003d71; font-family: Helvetica, Arial; font-size: 20px; line-height: 24px; margin: 0px;">Why are you called comclone.com?</h4>\r\n<blockquote style="color: #666666; font-family: Georgia; font-style: italic; font-size: 14px; padding: 15px; margin: 15px; border: 1px dotted #cfdabb;">Because it sounds fun and sexy. There is no actual stealing going on, but at the price we offer our daily deals you will just feel like you''re stealing. AMIRIGHT? But seriously these deals are fantastic.</blockquote>\r\n<h4 style="color: #003d71; font-family: Helvetica, Arial; font-size: 20px; line-height: 24px; margin: 0px;">Do I need to use my voucher the same day I bought it?</h4>\r\n<blockquote style="color: #666666; font-family: Georgia; font-style: italic; font-size: 14px; padding: 15px; margin: 15px; border: 1px dotted #cfdabb;">That is really up to you and how excited about the deal you are. Though many of the coupons have expiration dates they will never be within a day of the time that you bought it. That would be crazy, we get that your life is busy. Maybe your late for pottery. Maybe you have an eighteenth century bridge building class you have to teach. We don''t know we''re just trying to help.</blockquote>\r\n<h4 style="color: #003d71; font-family: Helvetica, Arial; font-size: 20px; line-height: 24px; margin: 0px;">Why is there only one deal a day? I wanna steal more deals!</h4>\r\n<blockquote style="color: #666666; font-family: Georgia; font-style: italic; font-size: 14px; padding: 15px; margin: 15px; border: 1px dotted #cfdabb;">Remember the thing about the chocolate and the bees? Have you not experienced this?</blockquote>\r\n<h4 style="color: #003d71; font-family: Helvetica, Arial; font-size: 20px; line-height: 24px; margin: 0px;">If I''m a business owner how do I get featured on comclone.com.com?</h4>\r\n<blockquote style="color: #666666; font-family: Georgia; font-style: italic; font-size: 14px; padding: 15px; margin: 15px; border: 1px dotted #cfdabb;">There are so many ways! You can send us an email at&nbsp;<a style="color: #3a9ab6; text-decoration: none;" href="http://www.stealthedeal.com/sales@StealTheDeal.com">info@comclone.com.com</a>&nbsp;or you can just email us through the site. Or you could Facebook us! In fact if you have a business feel free to contact us in anyway you know how! Twitter, Facebook, email, carrier pigeon, smoke signals, rock through the window with a note tied around it. Hmm Ok well maybe don''t do that but you get the idea.</blockquote>\r\n<h4 style="color: #003d71; font-family: Helvetica, Arial; font-size: 20px; line-height: 24px; margin: 0px;">Wait. I can retweet your deals? That''s ok?</h4>\r\n<blockquote style="color: #666666; font-family: Georgia; font-style: italic; font-size: 14px; padding: 15px; margin: 15px; border: 1px dotted #cfdabb;">Yes! Absolutely retweet our deals. The only way you could make them better is by sharing them with your friends! Its no fun going places by yourself and people who say that they enjoy it are secretly lonely anyway. Tonight they are renting three or four Harrison Ford movies and eating a chicken for one. What are you doing? Who knows? You and all your hundreds of friends like to keep your options open in case someone tweets about something too good to ignore. You live life wild and loose and you like it that way.</blockquote>\r\n<h4 style="color: #003d71; font-family: Helvetica, Arial; font-size: 20px; line-height: 24px; margin: 0px;">Can I get a refund if something goes wrong?</h4>\r\n<blockquote style="color: #666666; font-family: Georgia; font-style: italic; font-size: 14px; padding: 15px; margin: 15px; border: 1px dotted #cfdabb;">We here at comclone.com are dedicated to making everyone happy. Except Brian, he knows what he did, but that''s beside the point. If you feel like you need a refund send an email to<a style="color: #3a9ab6; text-decoration: none;" href="mailto:sales@StealTheDeal.com">info@comclone.com.com</a>&nbsp;or give us a call at 1-800-243-5994. Unless it''s you Brian we''ll find you one of these days.</blockquote>\r\n<h4 style="color: #003d71; font-family: Helvetica, Arial; font-size: 20px; line-height: 24px; margin: 0px;">I have all these Japanese yen lying all over the place. Can I use them to buy deals?</h4>\r\n<blockquote style="color: #666666; font-family: Georgia; font-style: italic; font-size: 14px; padding: 15px; margin: 15px; border: 1px dotted #cfdabb;">Well, the answer is yes but only if you go to the bank and have them exchanged into Canadian Dollars. All our prices are in Canadian dollars. Like us, we are in Canada also!</blockquote>\r\n<h4 style="color: #003d71; font-family: Helvetica, Arial; font-size: 20px; line-height: 24px; margin: 0px;">Where are you guys based?</h4>\r\n<blockquote style="color: #666666; font-family: Georgia; font-style: italic; font-size: 14px; padding: 15px; margin: 15px; border: 1px dotted #cfdabb;">comclone.com is headquartered in Guelph Ontario and is expanding RIGHT NOW. If you listen close you can hear it.</blockquote>', 0, '2011-03-02 07:09:01');
